import React, { Component } from 'react'

export default class User extends Component {
    render() {
        return (
            <React.Fragment>
                <div>
                    <h1>Welcome Krups</h1>
                    <button onClick="this.props.clickData">Logout</button>
                </div>
            </React.Fragment>
        )
    }
}
